import './Register.css';
import { createUser } from '../service.js';

import { Link } from 'react-router-dom';
import { useState } from "react";

function Register() {

    const[email, setEmail] = useState("");
    const[password, setPassword] = useState("");
    const[user, setUser] = useState();
    const[message, setMessage] = useState("");

    function createUser(){
        
        createUser(user)
        .then(response => {
            console.log(response);
            this.setState({numberOfUsers: this.state.numberOfUsers + 1})
        });
    }


    return(
        <div>
            <form id="login-form" >
                <div class="mb-3">
                    <label class="form-label">Email address</label>
                    <input type="email" class="form-control" required></input>
                </div>
                <div class="mb-3">
                    <label for="inputPassword5" class="form-label">Password</label>
                    <input type="password" class="form-control" required></input>
                </div>
                <button type="submit" class="btn btn-primary mx-auto d-block">Register</button>
                <p>{message}</p>
                <Link to="/login">Login</Link>
            </form>
        </div>
    )
}

export default Register;
